#include <bits/stdc++.h>
using namespace std;
#define FILES freopen("in.txt","r",stdin);freopen("out.txt","w",stdout);
#define fast_io ios_base::sync_with_stdio(0); cin.tie(0);

void solve() {
    int n;
    cin >> n;
    vector<vector<int>> a(n, vector<int> (n, 0));
    int num = 1;
    int row = 0, col = 0;
    int maxRow = n - 1, maxCol = n - 1;
    int minRow = 0, minCol = 0;

    while (num <= n * n) {
        for (int i = minCol; i <= maxCol; ++i) {
            a[minRow][i] = num++;
        }
        ++minRow;

        for (int i = minRow; i <= maxRow; ++i) {
            a[i][maxCol] = num++;
        }
        --maxCol;

        for (int i = maxCol; i >= minCol; --i) {
            a[maxRow][i] = num++;
        }
        --maxRow;

        for (int i = maxRow; i >= minRow; --i) {
            a[i][minCol] = num++;
        }
        ++minCol;

    }

    for (int i = 0; i < n; ++i) {
        for (int j = 0; j < n; ++j) {
            std::cout << a[i][j] << "\t";
        }
        std::cout << std::endl;
    }
}

signed main() {
    FILES
    int t = 1;
    while (t--) {
        solve();
    }
    return 0;
}

