struct point{
    double x, y;

    double calculateArea(point& p2, point& p3) {
        point p1;
        p1.x = this->x;
        p1.y = this->y;
        return 0.5 * abs(p1.x * (p2.y - p3.y) + p2.x * (p3.y - p1.y) + p3.x * (p1.y - p2.y));
    }
};

void solve() {
    point a, b, c, p;
    cin >> a.x >> a.y >> b.x >> b.y >> c.x >> c.y >> p.x >> p.y;
    
    double ABC = a.calculateArea(b, c);
    double ABP = a.calculateArea(b, p);
    double ACP = a.calculateArea(c, p);
    double BCP = b.calculateArea(c, p);

    if (abs(ABC - (ABP + ACP + BCP)) < 0.0001) {
        cout << "Да";
    } else {
        cout << "Нет";
    }
}
signed main() {
    FILES
    int t = 1;
    while (t--) {
        solve();
    }

    return 0;
}

