int maxn = 250250;
vector<bool> eratosthen(int n){ 
    vector<bool> a(n, true);
    a[0] = a[1] = false;
    for (int i = 2; i < int(sqrt(n)) + 1; ++i) 
        if (a[i] == true) 
            for (int j = i * i; j < n; j += i) 
                a[j] = false;
    
    return a;
}

void solve() {
    vector<bool> resheto = eratosthen(maxn);
    int a, b;
    cin >> a >> b;

    for (int i = a; i <= b; ++i) 
        if (resheto[i])
            cout << i << " ";
}

signed main() {
    FILES

    int t = 1;
    while (t--) {
        solve();
    }
    
    return 0;
}

