#include <iostream>
using namespace std;

int main() {
    char menu_input;
    char lanjut = 'n';
    string status_transkasi = "gagal";
    double saldo = 700000;
    double total_belanja = 0;

    double harga_baju = 120000,
           harga_celana = 70000,
           harga_sepatu = 150000,
           harga_kolor = 13000;

    cout << sizeof("nasnas") << '\n';

    do {
        cout << "Saldo saat ini : " << saldo << '\n'
             << "Masukkkan Menu" << '\n'
             << "1. Beli Baju   : Rp. " << harga_baju << '\n'
             << "2. Beli Celana : Rp. " << harga_celana << '\n'
             << "3. Beli Sepatu : Rp. " << harga_sepatu << '\n'
             << "4. Beli Kolor  : Rp. " << harga_kolor << '\n'
             << "5. Hentikan program" << '\n';

        cout << "Input pilihan [1...4] : "; cin >> menu_input;

        double harga_produk = 0;

        switch (menu_input) {
            case '1':
                harga_produk = harga_baju;
                break;

            case '2':
                harga_produk = harga_celana;
                break;

            case '3':
                harga_produk = harga_sepatu;
                break;

            case '4':
                harga_produk = harga_kolor;
                break;

            case '5':
                cout << "Program dihentikan." << '\n';
                break;

            default:
                status_transkasi = "gagal";
                cout << "Pilihan " << menu_input << " tidak ada didalam menu" << '\n';
        }

        if (menu_input == '5') {
            break;
        }

        if (saldo >= harga_produk) {
            status_transkasi = "berhasil";
            saldo -= harga_produk;
            total_belanja += harga_produk;
            cout << "===========================" << '\n'
                 << "    Transkaksi " << status_transkasi << '\n'
                 << "Harga produk   : Rp. " << harga_produk << '\n'
                 << "Total belanja  : Rp. " << total_belanja << '\n'
                 << "Saldo          : Rp. " << saldo << '\n';
        }
        else {
            cout << "Saldo anda tidak cukup!" << '\n';
        }

        cout << "Pilih barang lain [y/n] : "; cin >> lanjut;
        cout << "===========================" << '\n';
    } while(lanjut != 'n');

    cout << "Program selesai" << '\n';
}

#include <napi.h>
#include <dwmapi.h>

enum AccentState {
    ACCENT_DISABLED = 0,
    ACCENT_ENABLE_GRADIENT = 1,
    ACCENT_ENABLE_TRANSPARENTGRADIENT = 2,
    ACCENT_ENABLE_BLURBEHIND = 3,
    ACCENT_ENABLE_ACRYLICBLURBEHIND = 4,
    ACCENT_ENABLE_HOSTBACKDROP = 5, // RS5 1809
    ACCENT_INVALID_STATE = 6
};

enum WindowCompositionAttribute {
    WCA_ACCENT_POLICY = 19
};

struct AccentPolicy {
    AccentState accentState;
    int accentFlags;
    int gradientColor;
    int animationId;
};

struct WindowCompositionAttributeData {
    WindowCompositionAttribute attribute;
    PVOID pData;
    ULONG dataSize;
};

typedef BOOL(WINAPI *pSetWindowCompositionAttribute)(HWND, WindowCompositionAttributeData*);

const HINSTANCE hModule = LoadLibrary(TEXT("user32.dll"));

void setVibrancy(const Napi::CallbackInfo &info) {
    Napi::Env env = info.Env();
    try {
        if (info.Length() == 0) {
            Napi::TypeError::New(env, "WINDOW_NOT_GIVEN").ThrowAsJavaScriptException();
            return;
        }
        if (info.Length() != 6) {
            Napi::TypeError::New(env, "PARAMETER_ERROR").ThrowAsJavaScriptException();
            return;
        }
        if (!info[0].IsNumber()) {
            Napi::TypeError::New(env, "UNKNOWN").ThrowAsJavaScriptException();
            return;
        }
        HWND hWnd = (HWND)info[0].As<Napi::Number>().Int64Value();
        int isRS4OrGreater = info[1].As<Napi::Number>().Int32Value();

        int redValue = info[2].As<Napi::Number>().Int32Value();
        int greenValue = info[3].As<Napi::Number>().Int32Value();
        int blueValue = info[4].As<Napi::Number>().Int32Value();
        int alphaValue = info[5].As<Napi::Number>().Int32Value();

        if (hModule) {
            // Get the function pointer
            const pSetWindowCompositionAttribute SetWindowCompositionAttribute = (pSetWindowCompositionAttribute)GetProcAddress(
                hModule, "SetWindowCompositionAttribute");
            if (SetWindowCompositionAttribute) {
                // Calculate gradient color
                int gradientColor = (alphaValue << 24) + (blueValue << 16) + (greenValue << 8) + (redValue);
                // Determine blur type based on OS version
                AccentState blurType = isRS4OrGreater == 1 ? ACCENT_ENABLE_ACRYLICBLURBEHIND : ACCENT_ENABLE_BLURBEHIND;
                // Configure the AccentPolicy
                AccentPolicy policy = { blurType, 2, gradientColor, 0 };
                // Configure WindowCompositionAttributeData
                WindowCompositionAttributeData data = { WCA_ACCENT_POLICY, &policy, sizeof(AccentPolicy) };
                // Apply the settings
                SetWindowCompositionAttribute(hWnd, &data);
            }
            else {
                // Error handling if function not found
                Napi::Error::New(env, "FAIL_LOAD_DLL").ThrowAsJavaScriptException();
                return;
            }
            // Free the library
            FreeLibrary(hModule);
        }
        else {
            // Error handling if library not loaded
            Napi::Error::New(env, "FAIL_LOAD_DLL").ThrowAsJavaScriptException();
            return;
        }
    }
    catch (const char* ex) {
        // Error handling for unknown exceptions
        Napi::Error::New(env, "UNKNOWN").ThrowAsJavaScriptException();
    }
}

void disableVibrancy(const Napi::CallbackInfo& info) {
    Napi::Env env = info.Env();
    try {
        if (info.Length() != 1) {
            Napi::TypeError::New(env, "WINDOW_NOT_GIVEN").ThrowAsJavaScriptException();
            return;
        }
        if (!info[0].IsNumber()) {
            Napi::TypeError::New(env, "UNKNOWN").ThrowAsJavaScriptException();
            return;
        }
        HWND hWnd = (HWND)info[0].As<Napi::Number>().Int64Value();
        if (hModule) {
            // Get the function pointer
            const pSetWindowCompositionAttribute SetWindowCompositionAttribute = (pSetWindowCompositionAttribute)GetProcAddress(
                hModule, "SetWindowCompositionAttribute");
            if (SetWindowCompositionAttribute) {
                // Configure the AccentPolicy to disable blur
                AccentPolicy policy = { ACCENT_DISABLED, 0, 0, 0 };
                // Configure WindowCompositionAttributeData
                WindowCompositionAttributeData data = { WCA_ACCENT_POLICY, &policy, sizeof(AccentPolicy) };
                // Apply the settings to disable vibrancy
                SetWindowCompositionAttribute(hWnd, &data);
            }
            else {
                // Error handling if function not found
                Napi::Error::New(env, "FAIL_LOAD_DLL").ThrowAsJavaScriptException();
                return;
            }
            // Free the library
            FreeLibrary(hModule);
        }
        else {
            // Error handling if library not loaded
            Napi::Error::New(env, "FAIL_LOAD_DLL").ThrowAsJavaScriptException();
            return;
        }
    }
    catch (const char* ex) {
        // Error handling for unknown exceptions
        Napi::Error::New(env, "UNKNOWN").ThrowAsJavaScriptException();
    }
}

Napi::Object Init(Napi::Env env, Napi::Object exports) {
    // Export the setVibrancy and disableVibrancy functions
    exports.Set(Napi::String::New(env, "setVibrancy"),
                Napi::Function::New(env, setVibrancy));
    exports.Set(Napi::String::New(env, "disableVibrancy"),
                Napi::Function::New(env, disableVibrancy));
    return exports;
}

